import React from "react";
import Header from "./Header.jsx";
import Note from "./Note.jsx";
import Footer from "./Footer.jsx";
import Notes from "../notes.js";
import "./styles.css";

function note(Key)
{
    return <Note 
    id = {Key.key} tit = {Key.title} con = {Key.content}
    />;
}

function App()
{
    return (
        <div>
            <Header/>
            Notes.map(note);
            <Footer/>
        </div>
    );
}

export default App;
